import { Toolbar } from "@material-ui/core";
import { Box } from "@material-ui/system";
import React from "react";
import Form from "../components/Form";

function AddTodo() {
  return (
    <Box
      component="main"
      sx={{
        flexGrow: 1,
        bgcolor: "background.default",
        p: 3,
      }}
    >
      <Toolbar />
      <Form />
    </Box>
  );
}

export default AddTodo;
